import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Navigate to User Profile (simulate clicking "Your Profile" link)
    // Try first visible "Your Profile" link
    const profileLink = await page.waitForSelector('a:text("Your Profile")', { timeout: 5000 });
    await profileLink.click();

    // Wait for profile content to load (look for .profile-page or .profile-header)
    await page.waitForSelector('.profile-header', { timeout: 5000 });

    // Take screenshot of profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract profile information
    // Full Name
    const fullName = await page.$eval('.profile-header .profile-info h2', el => el.textContent.trim());
    // Username
    const username = await page.$eval('.profile-header .profile-info .username', el => el.textContent.trim());
    // Bio
    const bio = await page.$eval('.profile-header .profile-info .bio', el => el.textContent.trim());
    // Profile Image
    const profileImage = await page.$eval('.profile-header .profile-image', el => el.getAttribute('src'));
    // Stats
    const stats = await page.$$eval('.profile-header .profile-stats .stat', nodes => {
      return nodes.map(node => {
        const number = node.querySelector('.stat-number')?.textContent.trim();
        const label = node.querySelector('.stat-label')?.textContent.trim();
        return { label, number };
      });
    });

    // Extract Jun's products (titles)
    const junProductTitles = await page.$$eval('.profile-sections .section:nth-of-type(1) .product-card .product-title', els =>
      els.map(el => el.textContent.trim())
    );

    // Extract Jun's reviews (titles and ratings)
    const junReviews = await page.$$eval('.profile-sections .section:nth-of-type(2) .review-item', nodes => {
      return nodes.map(node => {
        const productTitle = node.querySelector('.review-product-title')?.textContent.trim();
        const reviewTitle = node.querySelector('.review-title')?.textContent.replace(/"/g, '').trim();
        const reviewContent = node.querySelector('.review-content')?.textContent.trim();
        const reviewDate = node.querySelector('.review-date')?.textContent.trim();
        const reviewRating = node.querySelector('.review-rating .stars')?.textContent.trim();
        return { productTitle, reviewTitle, reviewContent, reviewDate, reviewRating };
      });
    });

    // Compose extracted data
    const extractedData = {
      fullName,
      username,
      bio,
      profileImage,
      stats,
      junProductTitles,
      junReviews
    };

    // Final screenshot with profile and data visible
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_data.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_data.png'));

    return {
      success: true,
      action: "Harvested user profile information including name, username, bio, profile image, stats, Jun's products, and reviews.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
